INSERT INTO `2013_stuzone_ann` VALUES (258,'根据湖北省教育考试院《关于做好2014年下半年全国计算机等级考试报名工作的通知》，2014年下半年全国计算机等级考试(湖北考区)（以下简称NCRE）定于9月20日—9月23日举行。我校的计算机等级考试报名工作于2014年5月13日正式开始。\n            \n    ','2014-05-13 14:17:42'),(259,'本学期学生证及火车票优惠卡现场集中补办时间为6月4日（周三）—6月6日（周五），中午不休息。学生证丢失及火车票优惠卡消磁的学生，请于5月30日前登录学生信息管理系统，进入学生证（火车票优惠卡）补办页面，提交补办申请。经辅导员、学校审核通过后，于6月4日—6月6日到大学生活动中心三楼学工部学生事务科办理相关补办手续。\n','2014-05-16 11:11:07'),(289,'距四六级考试还有28天，大家要加油噢。','2014-11-22 10:57:03'),(290,'','2014-11-23 20:03:37'),(291,'<span style=\"background-color: rgb(245, 245, 245);\">距四六级考试还有26天，大家要加油噢。</span>','2014-11-26 14:04:59'),(292,'','2014-11-26 20:03:46'),(293,'<span style=\"background-color: rgb(245, 245, 245);\">距四六级考试还有23天，大家要加油噢。</span>','2014-11-27 12:36:59'),(294,'又到周末了，是不是最近好开森，期中检测慢慢都没有了，但四六级要加油哦。','2014-11-29 08:27:52'),(295,'','2014-11-29 20:03:48'),(296,'','2014-11-29 20:30:26'),(297,'<span style=\"color: rgb(0, 0, 0); font-family: 宋体; font-size: medium; line-height: 24px; text-align: justify; text-indent: 30px;\">本学期学生证及火车票优惠卡现场集中补办时间为12月8日（周一）—12月10日（周三），中午不休息。学生证丢失及火车票优惠卡消磁的学生，请于12月7日前登录学生信息管理系统，进入学生证（火车票优惠卡）补办页面，提交补办申请。经辅导员、学校审核通过后，于12月8日—12月10日到大学生活动中心三楼学工部学生事务科办理相关补办手续。</span>','2014-12-01 06:54:00'),(298,'本学期学生证及火车票优惠卡现场集中补办时间为12月8日（周一）—12月10日（周三），中午不休息。学生证丢失及火车票优惠卡消磁的学生，请于12月7日前登录学生信息管理系统，进入学生证（火车票优惠卡）补办页面，提交补办申请。经辅导员、学校审核通过后，于12月8日—12月10日到大学生活动中心三楼学工部学生事务科办理相关补办手续。','2014-12-03 14:48:15'),(299,'本学期学生证及火车票优惠卡现场集中补办时间为12月8日（周一）—12月10日（周三），中午不休息。学生证丢失及火车票优惠卡消磁的学生，请于12月7日前登录学生信息管理系统，进入学生证（火车票优惠卡）补办页面，提交补办申请。经辅导员、学校审核通过后，于12月8日—12月10日到大学生活动中心三楼学工部学生事务科办理相关补办手续。','2014-12-05 10:32:04'),(300,'','2014-12-05 11:12:57'),(301,'','2014-12-05 11:17:17'),(302,'本学期学生证及火车票优惠卡现场集中补办时间为12月8日（周一）—12月10日（周三），中午不休息。学生证丢失及火车票优惠卡消磁的学生，请于12月7日前登录学生信息管理系统，进入学生证（火车票优惠卡）补办页面，提交补办申请。经辅导员、学校审核通过后，于12月8日—12月10日到大学生活动中心三楼学工部学生事务科办理相关补办手续。','2014-12-06 05:19:27'),(303,'','2014-12-06 07:23:32'),(304,'','2014-12-07 07:29:02'),(305,'','2014-12-08 07:25:09'),(306,'','2014-12-08 20:03:53'),(307,'','2014-12-09 07:27:09'),(3